bool ConvertImage(const char *pszFileName)
{
  HANDLE hFile = NULL;
  if ( !SFileOpenFileEx(NULL, pszFileName, SFILE_FROM_ABSOLUTE, &hFile) || !hFile)
  {
    err("file not found");
    return false;
  }
  DWORD dwFileSize = SFileGetFileSize(hFile, NULL);
  if ( !dwFileSize )
  {
    err("no size");
    SFileCloseFile(hFile);
    return false;
  }
  void *inBuff = SMAlloc(dwFileSize);
  DWORD dwBytesRead = 0;
  SFileReadFile(hFile, inBuff, dwFileSize, &dwBytesRead, 0);
  SFileCloseFile(hFile);
  if ( dwBytesRead != dwFileSize )
  {
    err("bad read size");
    return false;
  }
  DWORD dwWidth  = 0;
  DWORD dwHeight = 0;
  SBmpDecodeImage(SBMP_DEFAULT, inBuff, dwFileSize, NULL, NULL, 0, &dwWidth, &dwHeight);

  if ( !dwWidth || !dwHeight )
  {
    err("width height");
    return false;
  }

  BYTE *outBuff = (BYTE*)SMAlloc(dwWidth * dwHeight);
  PALETTEENTRY palette[256] = { 0 };
  SBmpDecodeImage(SBMP_DEFAULT, inBuff, dwFileSize, palette, outBuff, dwWidth * dwHeight);
  SMFree(inBuff);

  FILE *out = fopen("convertOutput.h", "a+");
  if ( !out )
  {
    err("out");
    return false;
  }

  fprintf(out, "%s {", pszFileName);
  for ( DWORD y = 0; y < dwHeight; ++y )
  {
    fprintf(out, "\n  ");
    for ( DWORD x = 0; x < dwWidth; ++x )
    {
      DWORD dwIndex = outBuff[y * dwWidth + x];
      fprintf(out, "0x%02X, ", dwIndex ? BWAPI::Color(palette[dwIndex].peRed, palette[dwIndex].peGreen, palette[dwIndex].peBlue).getID() : 0 );
    }
  }
  fprintf(out, "\n}\n\n");

  SMFree(outBuff);
  fclose(out);
  return true;
}

DWORD dwLastTick;
int seq;
void DrawHoliday()
{
  switch ( gdwHoliday )
  {
  case 1:
    {
      DWORD dwThisTick = GetTickCount();
      if ( dwThisTick - dwLastTick > 600 )
      {
        dwLastTick = dwThisTick;
        seq = seq ? 0 : 1;
        wantRefresh = true;
      }
      for ( int p = 0; p <= BW::BWDATA_GameScreenBuffer->wid / 51; ++p )
      {
        for ( int y = 0; y < 69; ++y )
          for ( int x = 0; x < 51 && (p*51)+x < BW::BWDATA_GameScreenBuffer->wid; ++x )
          {
            if ( cl[p%4][seq][y][x] )
              BW::BWDATA_GameScreenBuffer->data[(p*51) + x + y * BW::BWDATA_GameScreenBuffer->wid] = cl[p%4][seq][y][x];
          }
      }
      break;
    }
  } // switch

}
